import React from 'react';
import { Link } from "react-router-dom";
import useMediaQuery from "@material-ui/core/useMediaQuery";

function Nav() {

	const tablet = useMediaQuery("(min-width: 600px)");
	const desktop = useMediaQuery("(min-width: 900px)");

  return (
  	<>
  	{ tablet ?
    <nav className="Nav">
    	<ul>

    		<Link to="/">
    			<li>HOME</li>
    		</Link>

    		<Link to="/portfolio">
    			<li>PORTFOLIO</li>
    		</Link>

    		<Link to="/contact">
    			<li>CONTACT ME</li>
    		</Link>

    	</ul>
    </nav>
    : null
  	}
  	</>
  );
}

export default Nav;
